// Profile.js
import React from 'react';
import './style.css'; // Import the CSS file

const Profile = ({ car }) => {
  return (
    <div className="car-profile">
      <img className="car-image" src={car.image} alt={car.name} />
      <div className="car-details">
        <h2 className="car-name">{car.name}</h2>
        <p className="car-description">{car.description}</p>
        <p className="car-price">Price: R{car.price}</p>
        <p className={`rental-status ${car.available ? 'available' : 'unavailable'}`}>
          {car.available ? 'Available for Rental' : 'Currently Unavailable'}
        </p>
        <button className="rent-button" disabled={!car.available}>
          {car.available ? 'Rent Now' : 'Not Available'}
        </button>
      </div>
    </div>
  );
};

export default Profile;
